        }
    }

    componentDidMount() {
        console.log(this.state)
    }

    render() {
        return (
            <div>
                 <h1>Conferences</h1>
                 {this.state.conferences.map(conference => {
                     return <div>conference</div>
                 })}
            </div>
        )
    }
}

